DECLARE
    v_invitation JSONB;
    v_invitation_ids UUID[] := '{}';
    v_invitation_id UUID;
    v_failed_emails TEXT[] := '{}';
BEGIN
    FOREACH v_invitation IN ARRAY p_invitations
    LOOP
        BEGIN
            INSERT INTO invitations (
                issuer_id,
                issuer_organisation_id,
                recipient_email,
                event_id,
                invitation_code,
                expires_at
            )
            VALUES (
                p_issuer_id,
                p_issuer_organisation_id,
                v_invitation->>'email',
                p_event_id,
                generate_invitation_code(),
                COALESCE((v_invitation->>'expires_at')::TIMESTAMPTZ, NOW() + INTERVAL '30 days')
            )
            RETURNING invitation_id INTO v_invitation_id;

            v_invitation_ids := array_append(v_invitation_ids, v_invitation_id);
        EXCEPTION
            WHEN OTHERS THEN
                v_failed_emails := array_append(v_failed_emails, v_invitation->>'email');
        END;
    END LOOP;

    RETURN jsonb_build_object(
        'created', array_length(v_invitation_ids, 1),
        'failed', array_length(v_failed_emails, 1),
        'invitation_ids', v_invitation_ids,
        'failed_emails', v_failed_emails,
        'status', 'success'
    );
END;

DECLARE
    v_max_tickets INTEGER;
    v_sold INTEGER;
BEGIN
    SELECT max_tickets, sold INTO v_max_tickets, v_sold
    FROM event_tickets
    WHERE event_ticket_id = p_event_ticket_id;

    IF v_max_tickets IS NULL THEN
        RETURN NULL; -- Unlimited tickets
    END IF;

    RETURN GREATEST(0, v_max_tickets - COALESCE(v_sold, 0));
END;

DECLARE
    v_item JSONB;
    v_subtotal DECIMAL := 0;
    v_discount_amount DECIMAL := 0;
    v_total DECIMAL := 0;
    v_line_items JSONB := '[]'::JSONB;
BEGIN
    -- Calculate line items
    FOREACH v_item IN ARRAY p_ticket_items
    LOOP
        DECLARE
            v_price DECIMAL;
            v_quantity INTEGER;
            v_line_total DECIMAL;
        BEGIN
            SELECT price INTO v_price
            FROM event_tickets
            WHERE event_ticket_id = (v_item->>'event_ticket_id')::UUID;

            v_quantity := (v_item->>'quantity')::INTEGER;
            v_line_total := v_price * v_quantity;
            v_subtotal := v_subtotal + v_line_total;

            v_line_items := v_line_items || jsonb_build_object(
                'event_ticket_id', v_item->>'event_ticket_id',
                'quantity', v_quantity,
                'unit_price', v_price,
                'line_total', v_line_total
            );
        END;
    END LOOP;

    -- Apply discount if provided (implement discount logic as needed)
    IF p_discount_code IS NOT NULL THEN
        -- Placeholder for discount logic
        v_discount_amount := 0;
    END IF;

    v_total := v_subtotal - v_discount_amount;

    RETURN jsonb_build_object(
        'line_items', v_line_items,
        'subtotal', v_subtotal,
        'discount_amount', v_discount_amount,
        'discount_code', p_discount_code,
        'total', v_total,
        'currency', 'AUD'
    );
END;

DECLARE
    v_contact RECORD;
    v_event RECORD;
    v_eligible BOOLEAN := false;
    v_reasons TEXT[] := '{}';
BEGIN
    -- Get contact details
    SELECT * INTO v_contact
    FROM contacts
    WHERE email = p_contact_email;

    -- Get event details
    SELECT * INTO v_event
    FROM events
    WHERE event_id = p_event_id;

    IF NOT FOUND THEN
        RETURN jsonb_build_object(
            'eligible', false,
            'reasons', ARRAY['Event not found'],
            'status', 'error'
        );
    END IF;

    -- Check visibility
    CASE v_event.visibility
        WHEN 'public' THEN
            v_eligible := true;
        WHEN 'members' THEN
            IF v_contact.type = 'mason' THEN
                v_eligible := true;
            ELSE
                v_reasons := array_append(v_reasons, 'Event is for members only');
            END IF;
        WHEN 'invitation' THEN
            IF EXISTS (
                SELECT 1 FROM invitations
                WHERE event_id = p_event_id
                AND recipient_email = p_contact_email
                AND (expires_at IS NULL OR expires_at > NOW())
                AND used_at IS NULL
            ) THEN
                v_eligible := true;
            ELSE
                v_reasons := array_append(v_reasons, 'Valid invitation required');
            END IF;
        WHEN 'private' THEN
            v_reasons := array_append(v_reasons, 'Event is private');
    END CASE;

    -- Check event status
    IF v_event.status != 'published' THEN
        v_eligible := false;
        v_reasons := array_append(v_reasons, 'Event is not available');
    END IF;

    -- Check capacity
    IF v_event.total_capacity IS NOT NULL THEN
        DECLARE
            v_sold_count INTEGER;
        BEGIN
            SELECT COALESCE(SUM(sold), 0) INTO v_sold_count
            FROM event_tickets
            WHERE event_id = p_event_id;

            IF v_sold_count >= v_event.total_capacity THEN
                v_eligible := false;
                v_reasons := array_append(v_reasons, 'Event is sold out');
            END IF;
        END;
    END IF;

    RETURN jsonb_build_object(
        'eligible', v_eligible,
        'reasons', v_reasons,
        'contact_type', v_contact.type,
        'event_visibility', v_event.visibility,
        'status', 'success'
    );
END;

DECLARE
    v_expired_drafts INTEGER;
    v_expired_reservations INTEGER;
    v_expired_registrations INTEGER;
BEGIN
    -- Delete expired drafts
    DELETE FROM registration_drafts
    WHERE expires_at < NOW();
    GET DIAGNOSTICS v_expired_drafts = ROW_COUNT;

    -- Release expired reserved tickets (15 minutes)
    WITH expired_tickets AS (
        SELECT t.ticket_id, t.event_ticket_id
        FROM tickets t
        WHERE t.type = 'reserved'
        AND t.created_at < NOW() - INTERVAL '15 minutes'
    )
    UPDATE event_tickets et
    SET sold = GREATEST(0, et.sold - sub.ticket_count)
    FROM (
        SELECT event_ticket_id, COUNT(*) as ticket_count
        FROM expired_tickets
        GROUP BY event_ticket_id
    ) sub
    WHERE et.event_ticket_id = sub.event_ticket_id;

    DELETE FROM tickets
    WHERE type = 'reserved'
    AND created_at < NOW() - INTERVAL '15 minutes';
    GET DIAGNOSTICS v_expired_reservations = ROW_COUNT;

    -- Clean up incomplete registrations older than 24 hours
    DELETE FROM registrations
    WHERE payment_status = 'unpaid'
    AND created_at < NOW() - INTERVAL '24 hours';
    GET DIAGNOSTICS v_expired_registrations = ROW_COUNT;

    RETURN jsonb_build_object(
        'expired_drafts', v_expired_drafts,
        'expired_reservations', v_expired_reservations,
        'expired_registrations', v_expired_registrations,
        'cleaned_at', NOW()
    );
END;

DECLARE
    v_code TEXT;
    v_exists BOOLEAN;
BEGIN
    LOOP
        v_code := UPPER(SUBSTRING(MD5(RANDOM()::TEXT || CLOCK_TIMESTAMP()::TEXT) FOR 8));

        SELECT EXISTS(SELECT 1 FROM tickets WHERE claim_code = v_code) INTO v_exists;

        EXIT WHEN NOT v_exists;
    END LOOP;

    RETURN v_code;
END;

DECLARE
    v_code TEXT;
    v_exists BOOLEAN;
BEGIN
    LOOP
        v_code := UPPER(SUBSTRING(MD5(RANDOM()::TEXT || CLOCK_TIMESTAMP()::TEXT) FOR 10));

        SELECT EXISTS(SELECT 1 FROM invitations WHERE invitation_code = v_code) INTO v_exists;

        EXIT WHEN NOT v_exists;
    END LOOP;

    RETURN v_code;
END;

DECLARE
    v_event_slug TEXT;
    v_sequence INTEGER;
BEGIN
    SELECT slug INTO v_event_slug FROM events WHERE event_id = p_event_id;

    SELECT COUNT(*) + 1 INTO v_sequence
    FROM tickets t
    JOIN event_tickets et ON t.event_ticket_id = et.event_ticket_id
    WHERE et.event_id = p_event_id;

    RETURN UPPER(v_event_slug || '-' || LPAD(v_sequence::TEXT, 6, '0'));
END;

DECLARE
    v_processed INTEGER := 0;
    v_failed INTEGER := 0;
    v_queue_item RECORD;
BEGIN
    FOR v_queue_item IN
        SELECT * FROM email_queue
        WHERE status = 'pending'
        AND scheduled_for <= NOW()
        AND attempts < 3
        ORDER BY scheduled_for
        LIMIT p_batch_size
        FOR UPDATE SKIP LOCKED
    LOOP
        -- Mark as processing
        UPDATE email_queue
        SET status = 'processing',
            attempts = attempts + 1,
            last_attempt_at = NOW()
        WHERE queue_id = v_queue_item.queue_id;

        -- The actual email sending will be done by calling the edge function
        -- This is just to mark items for processing
        v_processed := v_processed + 1;
    END LOOP;

    RETURN jsonb_build_object(
        'processed', v_processed,
        'failed', v_failed,
        'timestamp', NOW()
    );
END;

DECLARE
    v_ticket_request JSONB;
    v_available INTEGER;
    v_requested INTEGER;
    v_event_ticket_id UUID;
    v_result JSONB := '[]'::JSONB;
BEGIN
    -- Check availability for each ticket type
    FOREACH v_ticket_request IN ARRAY p_ticket_requests
    LOOP
        v_event_ticket_id := (v_ticket_request->>'event_ticket_id')::UUID;
        v_requested := (v_ticket_request->>'quantity')::INTEGER;

        -- Lock the row for update
        SELECT 
            CASE 
                WHEN max_tickets IS NULL THEN 999999 -- Unlimited
                ELSE max_tickets - COALESCE(sold, 0)
            END INTO v_available
        FROM event_tickets
        WHERE event_ticket_id = v_event_ticket_id
        FOR UPDATE;

        IF v_available < v_requested THEN
            RAISE EXCEPTION 'Insufficient tickets available for ticket type %', v_event_ticket_id;
        END IF;

        -- Update sold count temporarily
        UPDATE event_tickets
        SET sold = COALESCE(sold, 0) + v_requested
        WHERE event_ticket_id = v_event_ticket_id;

        v_result := v_result || jsonb_build_object(
            'event_ticket_id', v_event_ticket_id,
            'reserved', v_requested,
            'available_remaining', v_available - v_requested
        );
    END LOOP;

    RETURN jsonb_build_object(
        'reservations', v_result,
        'expires_at', (NOW() + INTERVAL '15 minutes')::TEXT,
        'status', 'success'
    );
END;

DECLARE
    v_old_holder_id UUID;
    v_new_holder_id UUID;
    v_result JSONB;
BEGIN
    -- Verify ownership
    SELECT c.contact_id INTO v_old_holder_id
    FROM tickets t
    JOIN contacts c ON t.ticket_holder_id = c.contact_id
    WHERE t.ticket_id = p_ticket_id
    AND c.email = p_requester_email
    AND t.type = 'issued'
    AND t.payment_status = 'paid';

    IF NOT FOUND THEN
        RAISE EXCEPTION 'Ticket not found or cannot be transferred';
    END IF;

    -- Check if already checked in
    IF EXISTS(SELECT 1 FROM check_ins WHERE ticket_id = p_ticket_id) THEN
        RAISE EXCEPTION 'Cannot transfer a ticket that has been checked in';
    END IF;

    -- Use the existing transfer function
    v_result := transfer_ticket(
        p_ticket_id,
        p_recipient_data->>'email',
        p_recipient_data,
        v_old_holder_id
    );

    RETURN v_result;
END;

DECLARE
    v_contact_id UUID;
    v_current_email TEXT;
    v_result JSONB;
BEGIN
    -- Verify ownership
    SELECT c.contact_id, c.email INTO v_contact_id, v_current_email
    FROM tickets t
    JOIN contacts c ON t.ticket_holder_id = c.contact_id
    WHERE t.ticket_id = p_ticket_id;

    IF NOT FOUND THEN
        RAISE EXCEPTION 'Ticket not found';
    END IF;

    IF v_current_email != p_requester_email THEN
        RAISE EXCEPTION 'Unauthorized to update this ticket';
    END IF;

    -- Update contact details
    UPDATE contacts
    SET 
        first_name = COALESCE(p_updates->>'first_name', first_name),
        last_name = COALESCE(p_updates->>'last_name', last_name),
        mobile_number = COALESCE(p_updates->>'mobile_number', mobile_number),
        dietary_requirements = COALESCE(p_updates->>'dietary_requirements', dietary_requirements),
        special_needs = COALESCE(p_updates->>'special_needs', special_needs),
        updated_at = NOW()
    WHERE contact_id = v_contact_id;

    v_result := jsonb_build_object(
        'contact_id', v_contact_id,
        'updated_fields', jsonb_object_agg(key, value) FILTER (WHERE value IS NOT NULL),
        'status', 'success'
    )
    FROM jsonb_each_text(p_updates);

    RETURN v_result;
END;

