            available = calculate_available_tickets(NEW.event_ticket_id)
        WHERE event_ticket_id = NEW.event_ticket_id;
    ELSIF TG_OP = 'UPDATE' AND OLD.type != 'issued' AND NEW.type = 'issued' THEN
        UPDATE event_tickets
        SET sold = COALESCE(sold, 0) + 1,
            available = calculate_available_tickets(NEW.event_ticket_id)
        WHERE event_ticket_id = NEW.event_ticket_id;
    ELSIF TG_OP = 'UPDATE' AND OLD.type = 'issued' AND NEW.type != 'issued' THEN
        UPDATE event_tickets
        SET sold = GREATEST(0, COALESCE(sold, 0) - 1),
            available = calculate_available_tickets(NEW.event_ticket_id)
        WHERE event_ticket_id = NEW.event_ticket_id;
    END IF;
    RETURN NEW;
END;

