DECLARE
    v_request JSONB;
    v_available INTEGER;
    v_requested INTEGER;
    v_validation_results JSONB := '[]'::JSONB;
    v_all_available BOOLEAN := true;
BEGIN
    FOREACH v_request IN ARRAY p_ticket_requests
    LOOP
        SELECT 
            CASE 
                WHEN et.max_tickets IS NULL THEN 999999
                ELSE et.max_tickets - COALESCE(et.sold, 0)
            END as available_count,
            et.name,
            et.price,
            et.status
        INTO v_available
        FROM event_tickets et
        WHERE et.event_ticket_id = (v_request->>'event_ticket_id')::UUID
        AND et.event_id = p_event_id;

        v_requested := (v_request->>'quantity')::INTEGER;

        IF v_available < v_requested THEN
            v_all_available := false;
        END IF;

        v_validation_results := v_validation_results || jsonb_build_object(
            'event_ticket_id', v_request->>'event_ticket_id',
            'requested', v_requested,
            'available', v_available,
            'is_available', v_available >= v_requested
        );
    END LOOP;

    RETURN jsonb_build_object(
        'all_available', v_all_available,
        'validations', v_validation_results,
        'timestamp', NOW()
    );
END;

